    public static String criarTabelaCerveja(){
        StringBuilder stringBuilder = new StringBuilder();

        stringBuilder.append("CREATE TABLE IF NOT EXISTS CERVEJA( ");
        stringBuilder.append("_id         INTEGER     NOT NULL PRIMARY KEY AUTOINCREMENT, ");
        stringBuilder.append("BARCODE     VARCHAR(13) NOT NULL, ");
        stringBuilder.append("MARCA       VARCHAR(20) NOT NULL, ");
        stringBuilder.append("ROTULO      VARCHAR(20) NOT NULL  ");
        stringBuilder.append("); ");

        return stringBuilder.toString();
    }

    public static String criarTabelaEstado() {
        StringBuilder stringBuilder = new StringBuilder();

        stringBuilder.append("CREATE TABLE IF NOT EXISTS ESTADO( ");
        stringBuilder.append("_id          INTEGER     NOT NULL PRIMARY KEY AUTOINCREMENT, ");
        stringBuilder.append("ESTADO       VARCHAR(40) NOT NULL, ");
        stringBuilder.append("SIGLA        VARCHAR(4)  NOT NULL  ");
        stringBuilder.append("); ");

        return stringBuilder.toString();
    }

    public static String criarTabelaCidade() {
        StringBuilder stringBuilder = new StringBuilder();

        stringBuilder.append("CREATE TABLE IF NOT EXISTS CIDADE( ");
        stringBuilder.append("_id          INTEGER     NOT NULL PRIMARY KEY AUTOINCREMENT, ");
        stringBuilder.append("CIDADE       VARCHAR(40) NOT NULL, ");
        stringBuilder.append("COD_ESTADO   INTEGER     NOT NULL ");
        stringBuilder.append("); ");

        return stringBuilder.toString();
    }

    public static String criarTabelaEstabelecimento() {
        StringBuilder stringBuilder = new StringBuilder();

        stringBuilder.append("CREATE TABLE IF NOT EXISTS ESTABELECIMENTO( ");
        stringBuilder.append("_id             INTEGER     NOT NULL PRIMARY KEY AUTOINCREMENT, ");
        stringBuilder.append("ESTABELECIMENTO VARCHAR(30) NOT NULL, ");
        stringBuilder.append("COD_CIDADE      INTEGER     NOT NULL  ");

        stringBuilder.append("); ");

        return stringBuilder.toString();
    }

    public static String criarTabelaPreco() {
        StringBuilder stringBuilder = new StringBuilder();

        stringBuilder.append("CREATE TABLE IF NOT EXISTS PRECO( ");
        stringBuilder.append("_id                 INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT, ");
        stringBuilder.append("PRECO               REAL    NOT NULL, ");
        stringBuilder.append("COD_CERVEJA         INTEGER NOT NULL, ");
        stringBuilder.append("COD_ESTABELECIMENTO INTEGER NOT NULL  ");
        stringBuilder.append("); ");

        return stringBuilder.toString();
    }
	
	public static String criarTrigger(){
		StringBuilder stringBuilder = new StringBuilder();
		
		stringBuilder.append("CREATE  TRIGGER updateOnDelete AFTER delete ON cerveja BEGIN delete from preco where cod_cerveja = OLD._id; END;");

        return stringBuilder.toString();
	}

